        "privacyPolicy": MessageLookupByLibrary.simpleMessage("מדיניות פרטיות"),
        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "על פי החוקים הווייטנאמיים, מידע של משתמשים כגון שמות, כתובות דוא״ל, סיסמאות ותאריך לידה יכול להיות מסווג כ״מידע אישי. \n \n בפרט, \n (א) על פי צו 72/2013, מידע אישי מוגדר כמידע המצורף לזיהוי זהותו ופרטיו האישיים של אדם כולל שם, גיל, כתובת, מספר תעודת זהות של אנשים, מספר טלפון, כתובת דוא״ל ומידע אחר כמפורט בחוק \n \n ( ב) לפי חוזר 25/2010, מידע אישי פירושו מידע מספיק כדי לזהות במדויק אדם, הכולל לפחות אחד מהפרטים הבאים: שם מלא, תאריך לידה, כיבוש, כותרת, כתובת איש קשר, כתובת דוא״ל, מספר טלפון, תעודת זהות מספר ודרכון. מידע על פרטיות אישית כולל רישום בריאות, רשומת תשלום מס, מספר כרטיס ביטוח לאומי, מספר כרטיס אשראי וסודות אישיים אחרים. \n \n חוזר 25 חל על ה איסוף ושימוש במידע אישי על ידי אתרים המופעלים על ידי רשויות ממשלת וייטנאם. חוזר 25 אינו חל ישירות על איסוף ושימוש במידע אישי על ידי אתרים המופעלים על ידי גורמים שאינם ממשלתיים. עם זאת, ניתן להחיל את הוראות חוזר 25 באנלוגיה. בנוסף, סביר להניח כי ישות שאינה ממשלתית תהיה כפופה לאותם תקנים או מחמירים יותר מאלו החלים על ישות ממשלתית. "),
